  `appl_amount` double DEFAULT NULL COMMENT 'Appl金额',
  `hce_times` int(11) DEFAULT NULL COMMENT 'HCE笔数',
  `hce_amount` double DEFAULT NULL COMMENT 'HCE金额',
  `sams_times` int(11) DEFAULT NULL COMMENT 'Sams笔数',
  `sams_amount` double DEFAULT NULL COMMENT 'Sams金额',
  PRIMARY KEY (`id`),
  KEY `day_idx` (`clear_date`)
