DROP TABLE IF EXISTS `ter_pos_terminal`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `ter_pos_terminal` (
  `id` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '编号',
  `import_date` date DEFAULT NULL COMMENT '进件日期',
  `down_date` date DEFAULT NULL COMMENT '下机日期',
  `install_date` date DEFAULT NULL COMMENT '装机日期',
  `trans_bank` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '交件支行',
  `device_num` varchar(25) COLLATE utf8_bin DEFAULT NULL COMMENT '机身号',
  `device_type` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '机子类型',
  `merchant_num` varchar(20) COLLATE utf8_bin NOT NULL COMMENT '商户号,重要字段',
  `terminal_num` varchar(20) COLLATE utf8_bin DEFAULT NULL,
  `wechat_url` varchar(512) COLLATE utf8_bin DEFAULT NULL COMMENT '微信二维码',
  `business_license` varchar(512) COLLATE utf8_bin DEFAULT NULL COMMENT '营业执照',
  `merchant_name` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '商户名称',
  `merchant_address` varchar(512) COLLATE utf8_bin DEFAULT NULL COMMENT '地址',
  `merchant_legal_person` varchar(10) COLLATE utf8_bin DEFAULT NULL COMMENT '法人',
  `booking_person` varchar(10) COLLATE utf8_bin DEFAULT NULL COMMENT '入帐人',
  `telphone` varchar(100) COLLATE utf8_bin DEFAULT NULL,
  `install_phone` varchar(18) COLLATE utf8_bin DEFAULT NULL COMMENT '装机电话',
  `device_mcc` varchar(10) COLLATE utf8_bin DEFAULT NULL COMMENT 'MCC码',
  `debit_rate` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '借记卡费率',
  `credit_rate` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '贷记卡费率',
  `foreign_rate` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '外币卡费率',
  `machine_type` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '机具类型',
  `id_card` varchar(18) COLLATE utf8_bin DEFAULT NULL COMMENT '身份证号',
  `bank_card` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '银行卡号',
  `bank_card_account_bank` varchar(18) COLLATE utf8_bin DEFAULT NULL COMMENT '银行卡开户行',
  `user_id` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '所属用户,重要字段',
  `salesman` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '业务员',
  `terminal_desc` text COLLATE utf8_bin COMMENT '详情',
  `create_by` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '创建者',
  `create_date` datetime NOT NULL COMMENT '创建时间',
  `update_by` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '更新者',
  `update_date` datetime NOT NULL COMMENT '更新时间',
  `remarks` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '备注信息',
  `del_flag` char(1) COLLATE utf8_bin NOT NULL DEFAULT '0' COMMENT '删除标记',
  PRIMARY KEY (`id`),
  UNIQUE KEY `termial_num` (`terminal_num`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='POS终端设备表';
